dataList.appIntro:
Versi baru Meecha sudah membuka era baru yang khususnya melayani orang asing secara global , kalian akan meninggalkan kesepian dalam kehidupan, komunikasi dengan orang lain akan menjadi lebih menarik, mungkin Anda akan bert emu dengan orang yang disukai Anda. Ia meliputi seluruh dunia, ia bisa menemukan teman baru berdasarkan geografi, buat lebih mudah bagi Anda untuk bertemu dengan orang lain di sekitar Anda, dibandingkan perangkat lunak sosial tradisional, ia mengintegrasikan elemen interaktif yang lebih segar, Tidak hanya bisa melalui teks、bahasa、video untuk menyampaikan kecintaan Anda kepada orang lain yang disukai Anda, tapi juga bisa membuat foto suara, memublikasikan siaran suara, biarkan orang-orang di sekitar segera berinisiatif menemani Anda mengobrol. 
Meecha, Kapan-kapan saja, di mana-mana saja untuk menemani Anda ngobrol, buat berteman lebih sederhana, biarkan pertemuan menjadi lebih menarik.
Ciri-ciri Meecha:
【sederhana】Hanya dua langkah mendaftar, jadi Anda bisa melihat orang-orang terdekat, menurut preferensi Anda, ia akan merekomendasikan orang-orang menurut usia dan minat;
【sekitar】Cari teman baru menurut jarak, abaikan jaraknya, cari yang kamu suka;
【nilai kecantikan orang】semua laki yang gandeng dan wanita yang cantik akan dipamerkan di mata Anda, dan romansa eksotis yang dari negara-negara dan bahasa yang berbeda sedang menunggu Anda;
【benar】pengguna yang benar, avatar yang benar, kalau suka bisa langsung tegur sapanya;
【Obrolan video】Acak dipasangkan, kalau suka bisa langsung obrol  , kalau tidak suka ganti orang lain;
【Self-timer】Album audio dan stiker animasi yang unik, membuat Anda lebih percaya diri dan lebih menyenangkan;
【tegur sapa】Lihat orang yang Anda suka, bisa langsung tegur sapa; 
【mudah digunakan】Mudah digunakan, gerakan slide bisa memainkan semua fitur;
【Aman tanpa pelecehan】Jangan ungkapkan informasi pribadi, harus ada respon jadi ngobrol;
